// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./NFTicket.sol";

contract Shop is Ownable {

    NFTicket public nfticket;

    constructor(NFTicket _nfticket,address _newOwner) {
        nfticket = _nfticket;
        transferOwnership(_newOwner);
    }



    function createTicketSale(uint256[] memory listOfQuantitiesById) external onlyOwner() {
        uint256[] memory avaiableIds = nfticket.getTicketIdentifierList();

        for (uint256 i = 0; i < avaiableIds.length; i++) {
            nfticket.mintTicket(uint8(avaiableIds[i]), listOfQuantitiesById[i]);
        }

    }

    function grantTickets (
        address _buyer,
        uint256 _id,
        uint256 _amount
    ) external onlyOwner(){
        require(_amount>0,"Mint at least 1 token!");
        nfticket.safeTransferFrom(_buyer, _id, _amount);
    }

    function onERC1155Received(
        address,
        address,
        uint256,
        uint256,
        bytes calldata
    ) external pure returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(
        address,
        address,
        uint256[] calldata,
        uint256[] calldata,
        bytes calldata
    ) external pure returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }
}
